import './main.css';
import './App.css';
import "react-loader-spinner/dist/loader/css/react-spinner-loader.css";
import React from 'react'
import {  BrowserRouter ,  Routes, Route } from "react-router-dom";
import Home from './page/home' 
import Contact from './page/contact' 
import About from './page/about' 
import Login from './page/login' 
import Register from './page/register' 
import MenuStudio from './page/menu_studio' 
import Dashboard from './page/dashboard' 
import axios from 'axios';

function App() {
  axios.defaults.baseURL = 'http://localhost/hyper_menu_php/public/api/';
  return (
    <div className="App">
          <BrowserRouter>
             <Routes>
                 <Route path="/" element={<Home />} />
                 <Route path="contact" element={<Contact />} />
                 <Route path="about" element={<About />} />
                 <Route path="login" element={<Login />} />
                 <Route path="register" element={<Register />} />
                 {/* <Route path="studio" element={<MenuStudio />} /> */}
                 <Route path="dashboard" element={<Dashboard />} />
                 <Route exact path="/studio/:id" render={(props) => (
    <MenuStudio id={props.match.params.id}/>
)} />

            </Routes>
        </BrowserRouter>
    </div>
  );
}

export default App;
